// src/components/common/AIChat.js
import React, { useState } from "react";
import { Send, Bot, User } from "lucide-react";

const AIChat = ({ mode = "user" }) => {
  const [messages, setMessages] = useState([
    {
      sender: "bot",
      text: "Hello ðŸ‘‹ Iâ€™m your AI Bond Assistant. How can I help you today?",
    },
  ]);
  const [input, setInput] = useState("");

  const handleSend = () => {
    if (!input.trim()) return;
    setMessages([...messages, { sender: "user", text: input }]);
    setInput("");
    // simulate AI reply
    setTimeout(() => {
      setMessages((prev) => [
        ...prev,
        { sender: "bot", text: "Got it âœ… Let me analyze that for you..." },
      ]);
    }, 800);
  };

  return (
    <div
      className={`flex flex-col h-full rounded-2xl shadow-lg border ${
        mode === "supervisor" ? "bg-gray-900 text-white" : "bg-white"
      }`}
    >
      {/* Header */}
      <div
        className={`px-6 py-4 font-bold text-lg border-b ${
          mode === "supervisor" ? "border-gray-700" : "border-gray-200"
        }`}
      >
        Bond AI Chat
      </div>

      {/* Context sidebar + Chat */}
      <div className="flex flex-1 overflow-hidden">
        {/* Context / Finance Panel */}
        <aside
          className={`w-1/4 hidden md:block p-4 border-r ${
            mode === "supervisor" ? "border-gray-700" : "border-gray-200"
          }`}
        >
          <h3 className="font-semibold mb-2">ðŸ“Š Context</h3>
          <ul className="space-y-2 text-sm opacity-80">
            <li>â€¢ Total Auctions: 12</li>
            <li>â€¢ Avg Yield: 5.2%</li>
            <li>â€¢ Next Bond Maturity: Jan 2030</li>
            <li>â€¢ Risk Rating: A+</li>
          </ul>
        </aside>

        {/* Chat window */}
        <div className="flex-1 flex flex-col">
          <div className="flex-1 overflow-y-auto px-6 py-4 space-y-4">
            {messages.map((msg, idx) => (
              <div
                key={idx}
                className={`flex items-start space-x-3 ${
                  msg.sender === "user" ? "justify-end" : "justify-start"
                }`}
              >
                {msg.sender === "bot" && (
                  <div className="p-2 bg-indigo-100 dark:bg-indigo-800 rounded-full">
                    <Bot size={18} />
                  </div>
                )}
                <div
                  className={`px-4 py-2 rounded-2xl max-w-md shadow-sm ${
                    msg.sender === "user"
                      ? "bg-indigo-600 text-white rounded-br-none"
                      : mode === "supervisor"
                      ? "bg-gray-800 text-gray-100 rounded-bl-none"
                      : "bg-gray-100 text-gray-900 rounded-bl-none"
                  }`}
                >
                  {msg.text}
                </div>
                {msg.sender === "user" && (
                  <div className="p-2 bg-indigo-600 text-white rounded-full">
                    <User size={18} />
                  </div>
                )}
              </div>
            ))}
          </div>

          {/* Suggestions */}
          <div
            className={`px-6 py-2 text-sm border-t flex space-x-3 overflow-x-auto ${
              mode === "supervisor" ? "border-gray-700" : "border-gray-200"
            }`}
          >
            {[
              "Show me upcoming auctions",
              "Analyze yield curve",
              "Risk analysis",
              "Auction history",
            ].map((s, i) => (
              <button
                key={i}
                onClick={() => setInput(s)}
                className="px-3 py-1 rounded-full border border-indigo-300 text-indigo-700 hover:bg-indigo-100 whitespace-nowrap"
              >
                {s}
              </button>
            ))}
          </div>

          {/* Input Box */}
          <div
            className={`flex items-center px-4 py-3 border-t ${
              mode === "supervisor" ? "border-gray-700" : "border-gray-200"
            }`}
          >
            <input
              type="text"
              value={input}
              onChange={(e) => setInput(e.target.value)}
              placeholder="Ask anything about bonds, auctions, yields..."
              className={`flex-1 px-4 py-2 rounded-full border focus:outline-none ${
                mode === "supervisor"
                  ? "bg-gray-800 border-gray-700 text-white"
                  : "bg-gray-100 border-gray-300"
              }`}
            />
            <button
              onClick={handleSend}
              className="ml-3 p-3 bg-indigo-600 text-white rounded-full shadow hover:bg-indigo-700"
            >
              <Send size={18} />
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AIChat;
